    [],nt"num_tags": 5,nt"name": "refuge-narrative-report-may-to-august-1952-kodiak-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kodiak NWR outlines
    Refuge accomplishments from May through August of 1952. The report begins by summarizing
    the weather conditions and water conditions during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    and mammals- is also covered. The Refuge development and maintenance section discusses
    physical developments. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes Refuge visitors,
    fishing, and violations. Items of interest and photographs are attached.",nt"owner_org":
